import { SET_ACTIVE_USER_ID } from "../ActionTypes/ActionTypes";
export default function activeUserId(state, action) {
  switch (action.type) {
    case SET_ACTIVE_USER_ID:
      console.log(action.payload + " inside the reducer");
      return {
        ...state,
        activeUserId: action.payload
      };

    default:
      return state;
  }
}
